import styled from 'styled-components';
import React from 'react';





const Wrapper = styled.div
`   display: flex;
    flex-flow: column;
    align-items: center;
    justify-content: center;
    height: 100%;
`;
const Logo = styled.img
`
border-radius: 10%;
max-width: 80%;
max-height: 80%;
`;
const Styleddiv = styled.div`

  display: flex;
  align-items: center;
  flex-flow: column;
  height: 10%;
  width: 80%;
  padding: 20px;
  padding-bottom : 40px;
  margin-bottom: 8% auto;
  margin-top: 13% auto;
  border: 1px solid #fffff;
  border-radius: 9px;
  background: #f7f7f7;
  h2 {
    font-family: Arial, Helvetica, sans-serif;
    font-size: 14px;
  }
  button {
    background: #ff8019;
    color: #fff;
    padding: 11px;
    margin-top: 15px;
    width: 80%;
    border: none;
    border-radius: 4px;
    box-sizing: border-box;
  }
`;

const Stylednav = styled.div`

  display: flex;
  align-items: center;
  flex-flow: column;
  height: 10%;
  width: 80%;
  padding: 20px;
  padding-bottom : 12px;
  margin-bottom: 5%;
  border: 1px solid #fffff;
  border-radius: 9px;
  background: #f7f7f7;
  h2 {
    font-family: Arial, Helvetica, sans-serif;
    font-size: 14px;
  }
  button {
    background: #ff8019;
    color: #fff;
    padding: 11px;
    margin-top: 15px;
    width: 80%;
    border: none;
    border-radius: 4px;
    box-sizing: border-box;
  }
`;
const Nav = styled.div
`  
display: flex;
align-items: center;
flex-flow: row;
`;

const Tab = styled.a
`
padding: 11px;
margin-left: 15px;
margin-right: 15px;
font-family: "Lucida Console", Monaco, monospace;
font-size: 100%;
cursor: pointer;
`;


class Forestpage extends React.Component{

    componentDidMount()
    {
        document.body.style.backgroundColor = "#dbdbdb";
    }
    render(){
        return(
            <Wrapper>
                <Stylednav>
                    <Logo src="/pokekoo.png" alt="pokekoo"/>
                    <Nav>
                        <Tab>Forest</Tab> 
                        <Tab>Pokedex</Tab>
                        <Tab>Logout</Tab>
                    </Nav>
                </Stylednav>
                <Styleddiv>
                    nav
                </Styleddiv>
            </Wrapper>
        );
    }
}
export default Forestpage;
